@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:ATM a owl:Class .
atm:BankComputer a owl:Class .
atm:Card a owl:Class .

atm:requestsVerification a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Card .

atm:checksBankCode a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Card .

atm:hasSerialNumber a owl:DatatypeProperty ;
  rdfs:domain atm:Card ;
  rdfs:range xsd:string .

atm:hasPassword a owl:DatatypeProperty ;
  rdfs:domain atm:Card ;
  rdfs:range xsd:string .

atm:hasBankCode a owl:DatatypeProperty ;
  rdfs:domain atm:Card ;
  rdfs:range xsd:string .

atm:isValid a owl:DatatypeProperty ;
  rdfs:domain atm:Card ;
  rdfs:range xsd:boolean .
